import React, { Component } from 'react';

export class Footer extends Component {
  render() {
    return (
      <footer className="bg-light text-dark p-4 d-flex">
          <p className='mr-auto' >Copyright &copy; Trung Vo</p>
          <div >
            <a className='fab fa-2x fa-facebook-square'><span>&nbsp;&nbsp;</span></a>
            <a className='fab fa-2x fa-instagram'><span>&nbsp;&nbsp;</span></a>
            <a className='fab fa-2x fa-youtube'><span>&nbsp;&nbsp;</span></a>
          </div>
      </footer>
    )
  }
}

export default Footer;
